import Vue from "vue";
import Vuex from "vuex";
import * as infoItems from "@/store/modules/infoItems";
import * as users from "@/store/modules/users";
export const namespaced = true;

Vue.use(Vuex);

export const store = new Vuex.Store({
  modules: {
    infoItems,
    users,
    notification,
    jwt,
  },
});
